/*!50003 CREATE*/ /*!50017 DEFINER=`ascanda`@`localhost`*/ /*!50003 TRIGGER `hapus_detail_item_keluar` AFTER DELETE ON `detail_item_keluar`
 FOR EACH ROW BEGIN

DELETE FROM hpp_keluar WHERE no_faktur = old.no_faktur AND kode_barang = old.kode_barang;


DELETE FROM jurnal_trans WHERE no_faktur = old.no_faktur;

END */;;
