/*!50003 CREATE*/ /*!50017 DEFINER=`ascanda`@`localhost`*/ /*!50003 TRIGGER `update_hpp_keluar` AFTER DELETE ON `hpp_masuk`
 FOR EACH ROW BEGIN

UPDATE hpp_keluar SET sisa_barang = sisa_barang + old.jumlah_kuantitas WHERE no_faktur = old.no_faktur_hpp_keluar AND kode_barang = old.kode_barang AND no_faktur_hpp_masuk = old.no_faktur_hpp_masuk;




END */;;
